import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import GlobalProvider from "./contexts/GlobalProvider";

import "./i18n";

//Import Scss
import "./assets/scss/themes.scss";

ReactDOM.render(
  <GlobalProvider>
    <App />
  </GlobalProvider>,
  document.getElementById("root")
);
